sys_script_include.script:
var cloudify_events = Class.create();
cloudify_events.prototype = {
    initialize: function() {
    },

	getEvents: function(filter_type, filter_value){
		var http = new cloudify_http("Cloudify Events", "Get Events", null);
		http.setQueryParam(filter_type, filter_value);
		var parsedResponse = http.execute();
		return parsedResponse.items;
	},

    type: 'cloudify_events'
};
